// ThreeDSimulation.js
import React from 'react';

const ThreeDSimulation = () => {
  return (
    <div className="flex-1 p-8">
      <h2 className="text-3xl font-semibold mb-4">3D Simulation</h2>
      <div className="bg-white shadow-md rounded-lg p-4">
        <div className="simulation-window bg-gray-200 flex items-center justify-center h-96">
          {/* Placeholder for 3D simulation */}
          <p>3D Simulation will be displayed here</p>
        </div>
      </div>
    </div>
  );
};

export default ThreeDSimulation;
